import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { io } from 'socket.io-client';

const socket = io('http://localhost:8000');

const Ajastin = () => {
  const { teamId } = useParams();
  const [selectedGroup, setSelectedGroup] = useState(null);
  const [isRunning, setIsRunning] = useState(false);
  const [elapsedTime, setElapsedTime] = useState(0);
  const [taskTimes, setTaskTimes] = useState({}); // Track individual task times

  useEffect(() => {
    document.title = `Team ${teamId}`;
    const newSocket = io('http://localhost:8000');

    newSocket.on('connect', () => {
      console.log('WebSocket connection is open.');
    });

    newSocket.on('disconnect', () => {
      console.log('WebSocket connection is closed.');
    });

    newSocket.on('selectedGroupUpdate', (updatedGroupData) => {
      console.log('Received updated group data:', updatedGroupData);
      const parsedData = JSON.parse(updatedGroupData);
      setSelectedGroup(parsedData);
      setIsRunning(false);
      setElapsedTime(0);
      setTaskTimes({}); // Reset task times when the group is updated

      localStorage.setItem('selectedGroup', updatedGroupData);
    });

    const storedSelectedGroup = localStorage.getItem('selectedGroup');
    if (storedSelectedGroup) {
      const parsedData = JSON.parse(storedSelectedGroup);
      setSelectedGroup(parsedData);
    }

    socket.emit('join', { teamId });

    return () => {
      if (newSocket.connected) {
        newSocket.disconnect();
      }
    };
  }, [teamId]);

  const handleTimerUpdate = (taskName) => {
    socket.emit('timerUpdate', {
      teamId,
      era: selectedGroup.groupInfo,
      taskName,
      isRunning,
      elapsedTime: taskTimes[taskName] || 0,
    });
  };

  const startTimer = () => {
    setIsRunning(true);
  };

  const stopTimer = (taskName) => {
    setIsRunning(false);
    setTaskTimes((prevTaskTimes) => ({
      ...prevTaskTimes,
      [taskName]: (prevTaskTimes[taskName] || 0) + elapsedTime,
    }));
    handleTimerUpdate(taskName);
  };

  const resetTimer = () => {
    setIsRunning(false);
    setElapsedTime(0);
    setTaskTimes({});
    handleTimerUpdate(); // Update all tasks
  };

  const formatTime = (milliseconds) => {
    const totalSeconds = Math.floor(milliseconds / 1000);
    const minutes = Math.floor(totalSeconds / 60);
    const remainingSeconds = totalSeconds % 60;
    const hundredths = Math.floor((milliseconds % 1000) / 10);

    return `${String(minutes).padStart(2, '0')}:${String(remainingSeconds).padStart(2, '0')}:${String(hundredths).padStart(2, '0')}`;
  };

  return (
    <div>
      <h2>{`Team ${teamId} Stopwatch`}</h2>
      {selectedGroup && (
        <div>
          <h3>Selected Tasks:</h3>
          <div>
            <p>Max Aika: {formatTime(selectedGroup.selectedTasks[0].max_aika * 100)}</p>
            <div className="timer">
              <span>{formatTime(elapsedTime)}</span>
            </div>
            <div className="controls">
              <button onClick={startTimer} disabled={isRunning}>
                Start
              </button>
              <button onClick={resetTimer}>Reset</button>
            </div>
          </div>
          <ul>
            {selectedGroup.selectedTasks.map((task, index) => (
              <li key={task.tehtävä_nimi}>
                <div>
                  <h3>{task.tehtävä_nimi}</h3>
                  <p>{`Task Time: ${formatTime(taskTimes[task.tehtävä_nimi] || 0)}`}</p>
                  <div className="controls">
                    <button onClick={() => stopTimer(task.tehtävä_nimi)} disabled={!isRunning}>
                      Stop
                    </button>
                  </div>
                </div>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default Ajastin;
